// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title AIDelegate
 * @dev Manual delegation system for AI bot with spending limits
 * @notice This replaces BrewIt delegation with a simpler, more direct approach
 */
contract AIDelegate is Ownable, ReentrancyGuard {
    struct DelegateInfo {
        address delegate;
        uint256 spendingLimit;
        uint256 spentAmount;
        bool isActive;
        uint256 createdAt;
        string[] allowedFunctions; // Functions the delegate can call
    }

    // Mapping from delegate address to their info
    mapping(address => DelegateInfo) public delegates;
    
    // Mapping from owner to their delegates
    mapping(address => address[]) public ownerDelegates;
    
    // Events
    event DelegateCreated(
        address indexed owner,
        address indexed delegate,
        uint256 spendingLimit,
        string[] allowedFunctions
    );
    
    event DelegateExecuted(
        address indexed delegate,
        address indexed to,
        uint256 value,
        bytes data,
        bool success
    );
    
    event SpendingLimitUpdated(
        address indexed delegate,
        uint256 newLimit
    );
    
    event DelegateDeactivated(address indexed delegate);

    constructor() {
        // Owner is set automatically
    }

    /**
     * @dev Create a new delegated account for AI bot
     * @param _delegate The address of the AI bot
     * @param _spendingLimit Maximum amount the bot can spend (in wei)
     * @param _allowedFunctions Array of function signatures the bot can call
     */
    function createDelegatedAccount(
        address _delegate,
        uint256 _spendingLimit,
        string[] memory _allowedFunctions
    ) external onlyOwner {
        require(_delegate != address(0), "Invalid delegate address");
        require(_spendingLimit > 0, "Spending limit must be greater than 0");
        require(!delegates[_delegate].isActive, "Delegate already exists");

        delegates[_delegate] = DelegateInfo({
            delegate: _delegate,
            spendingLimit: _spendingLimit,
            spentAmount: 0,
            isActive: true,
            createdAt: block.timestamp,
            allowedFunctions: _allowedFunctions
        });

        ownerDelegates[msg.sender].push(_delegate);

        emit DelegateCreated(msg.sender, _delegate, _spendingLimit, _allowedFunctions);
    }

    /**
     * @dev Execute a transaction via delegated account
     * @param _to Recipient address
     * @param _value Amount of KDA to send
     * @param _data Transaction data
     */
    function executeViaDelegate(
        address _to,
        uint256 _value,
        bytes calldata _data
    ) external nonReentrant {
        DelegateInfo storage delegateInfo = delegates[msg.sender];
        require(delegateInfo.isActive, "Delegate not active");
        require(delegateInfo.spentAmount + _value <= delegateInfo.spendingLimit, "Exceeds spending limit");

        // Update spent amount
        delegateInfo.spentAmount += _value;

        // Execute the transaction
        (bool success, ) = _to.call{value: _value}(_data);
        
        emit DelegateExecuted(msg.sender, _to, _value, _data, success);
        
        require(success, "Delegate call failed");
    }

    /**
     * @dev Execute a token transfer via delegated account
     * @param _token Token contract address
     * @param _to Recipient address
     * @param _amount Amount to transfer
     */
    function executeTokenTransfer(
        address _token,
        address _to,
        uint256 _amount
    ) external {
        DelegateInfo storage delegateInfo = delegates[msg.sender];
        require(delegateInfo.isActive, "Delegate not active");
        
        // Build transfer data
        bytes memory data = abi.encodeWithSignature("transfer(address,uint256)", _to, _amount);
        
        // Execute via delegate
        this.executeViaDelegate(_token, 0, data);
    }

    /**
     * @dev Update spending limit for a delegate
     * @param _delegate Delegate address
     * @param _newLimit New spending limit
     */
    function updateSpendingLimit(
        address _delegate,
        uint256 _newLimit
    ) external onlyOwner {
        require(delegates[_delegate].isActive, "Delegate not found");
        require(_newLimit > delegates[_delegate].spentAmount, "New limit too low");
        
        delegates[_delegate].spendingLimit = _newLimit;
        emit SpendingLimitUpdated(_delegate, _newLimit);
    }

    /**
     * @dev Reset spent amount (daily reset)
     * @param _delegate Delegate address
     */
    function resetSpentAmount(address _delegate) external onlyOwner {
        require(delegates[_delegate].isActive, "Delegate not found");
        delegates[_delegate].spentAmount = 0;
    }

    /**
     * @dev Deactivate a delegate
     * @param _delegate Delegate address
     */
    function deactivateDelegate(address _delegate) external onlyOwner {
        require(delegates[_delegate].isActive, "Delegate not found");
        delegates[_delegate].isActive = false;
        emit DelegateDeactivated(_delegate);
    }

    /**
     * @dev Get delegate information
     * @param _delegate Delegate address
     * @return info Delegate information
     */
    function getDelegateInfo(address _delegate) 
        external 
        view 
        returns (DelegateInfo memory info) 
    {
        return delegates[_delegate];
    }

    /**
     * @dev Get all delegates for an owner
     * @param _owner Owner address
     * @return delegateAddresses Array of delegate addresses
     */
    function getOwnerDelegates(address _owner) 
        external 
        view 
        returns (address[] memory delegateAddresses) 
    {
        return ownerDelegates[_owner];
    }

    /**
     * @dev Check if delegate can spend amount
     * @param _delegate Delegate address
     * @param _amount Amount to check
     * @return canSpendAmount Whether delegate can spend the amount
     * @return remainingAmount Remaining spendable amount
     */
    function canSpend(address _delegate, uint256 _amount) 
        external 
        view 
        returns (bool canSpendAmount, uint256 remainingAmount) 
    {
        DelegateInfo memory info = delegates[_delegate];
        if (!info.isActive) return (false, 0);
        
        remainingAmount = info.spendingLimit - info.spentAmount;
        canSpendAmount = _amount <= remainingAmount;
    }

    /**
     * @dev Emergency function to withdraw all funds
     */
    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    // Allow contract to receive KDA
    receive() external payable {}
}

contracts/CrossChainBridge.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title CrossChainBridge
 * @dev Cross-chain bridge for Kadena Chainweb EVM
 * @notice This contract handles bridging between different chains in Kadena's network
 */
contract CrossChainBridge is Ownable, ReentrancyGuard {
    struct BridgeTransaction {
        uint256 bridgeId;
        address token;
        uint256 amount;
        uint256 sourceChainId;
        uint256 targetChainId;
        address recipient;
        address sender;
        bool isProcessed;
        uint256 timestamp;
        bytes32 txHash;
    }

    struct ChainInfo {
        uint256 chainId;
        string name;
        bool isActive;
        address bridgeContract; // Bridge contract on target chain
    }

    // State variables
    mapping(uint256 => BridgeTransaction) public bridges;
    mapping(uint256 => ChainInfo) public supportedChains;
    mapping(address => bool) public supportedTokens;
    mapping(bytes32 => bool) public processedTransactions;
    
    uint256 public bridgeCounter;
    uint256 public bridgeFee; // Fee in wei
    uint256 public minBridgeAmount; // Minimum amount to bridge
    
    // Events
    event BridgeInitiated(
        uint256 indexed bridgeId,
        address indexed token,
        uint256 amount,
        uint256 sourceChainId,
        uint256 targetChainId,
        address indexed recipient
    );
    
    event BridgeCompleted(
        uint256 indexed bridgeId,
        bytes32 indexed txHash,
        uint256 targetChainId
    );
    
    event ChainAdded(
        uint256 indexed chainId,
        string name,
        address bridgeContract
    );
    
    event TokenSupported(address indexed token, bool supported);
    
    event BridgeFeeUpdated(uint256 oldFee, uint256 newFee);

    constructor() {
        bridgeFee = 0.001 ether; // 0.001 KDA fee
        minBridgeAmount = 0.01 ether; // 0.01 KDA minimum
    }

    /**
     * @dev Initiate a cross-chain bridge
     * @param _token Token address (0x0 for native KDA)
     * @param _amount Amount to bridge
     * @param _targetChainId Target chain ID
     * @param _recipient Recipient address on target chain
     */
    function initiateBridge(
        address _token,
        uint256 _amount,
        uint256 _targetChainId,
        address _recipient
    ) external payable nonReentrant {
        require(_amount >= minBridgeAmount, "Amount below minimum");
        require(_recipient != address(0), "Invalid recipient");
        require(supportedChains[_targetChainId].isActive, "Chain not supported");
        
        if (_token != address(0)) {
            require(supportedTokens[_token], "Token not supported");
            require(IERC20(_token).balanceOf(msg.sender) >= _amount, "Insufficient token balance");
            require(IERC20(_token).allowance(msg.sender, address(this)) >= _amount, "Insufficient allowance");
        } else {
            require(msg.value >= _amount + bridgeFee, "Insufficient KDA sent");
        }

        bridgeCounter++;
        bridges[bridgeCounter] = BridgeTransaction({
            bridgeId: bridgeCounter,
            token: _token,
            amount: _amount,
            sourceChainId: block.chainid,
            targetChainId: _targetChainId,
            recipient: _recipient,
            sender: msg.sender,
            isProcessed: false,
            timestamp: block.timestamp,
            txHash: bytes32(0)
        });

        // Transfer tokens to contract
        if (_token != address(0)) {
            IERC20(_token).transferFrom(msg.sender, address(this), _amount);
        }

        emit BridgeInitiated(bridgeCounter, _token, _amount, block.chainid, _targetChainId, _recipient);
    }

    /**
     * @dev Complete a bridge transaction (called by bridge operator)
     * @param _bridgeId Bridge ID to complete
     * @param _txHash Transaction hash on target chain
     */
    function completeBridge(
        uint256 _bridgeId,
        bytes32 _txHash
    ) external onlyOwner {
        BridgeTransaction storage bridge = bridges[_bridgeId];
        require(!bridge.isProcessed, "Bridge already processed");
        require(block.timestamp >= bridge.timestamp + 1 hours, "Bridge not ready");

        bridge.isProcessed = true;
        bridge.txHash = _txHash;

        // Transfer tokens to recipient
        if (bridge.token != address(0)) {
            IERC20(bridge.token).transfer(bridge.recipient, bridge.amount);
        } else {
            payable(bridge.recipient).transfer(bridge.amount);
        }

        emit BridgeCompleted(_bridgeId, _txHash, bridge.targetChainId);
    }

    /**
     * @dev Add a supported chain
     * @param _chainId Chain ID
     * @param _name Chain name
     * @param _bridgeContract Bridge contract address on target chain
     */
    function addSupportedChain(
        uint256 _chainId,
        string memory _name,
        address _bridgeContract
    ) external onlyOwner {
        require(_chainId != block.chainid, "Cannot add current chain");
        require(_bridgeContract != address(0), "Invalid bridge contract");

        supportedChains[_chainId] = ChainInfo({
            chainId: _chainId,
            name: _name,
            isActive: true,
            bridgeContract: _bridgeContract
        });

        emit ChainAdded(_chainId, _name, _bridgeContract);
    }

    /**
     * @dev Add or remove supported token
     * @param _token Token address
     * @param _supported Whether token is supported
     */
    function setSupportedToken(address _token, bool _supported) external onlyOwner {
        supportedTokens[_token] = _supported;
        emit TokenSupported(_token, _supported);
    }

    /**
     * @dev Update bridge fee
     * @param _newFee New bridge fee
     */
    function updateBridgeFee(uint256 _newFee) external onlyOwner {
        uint256 oldFee = bridgeFee;
        bridgeFee = _newFee;
        emit BridgeFeeUpdated(oldFee, _newFee);
    }

    /**
     * @dev Update minimum bridge amount
     * @param _newMinAmount New minimum amount
     */
    function updateMinBridgeAmount(uint256 _newMinAmount) external onlyOwner {
        minBridgeAmount = _newMinAmount;
    }

    /**
     * @dev Get bridge transaction info
     * @param _bridgeId Bridge ID
     * @return bridge Bridge transaction info
     */
    function getBridgeInfo(uint256 _bridgeId) 
        external 
        view 
        returns (BridgeTransaction memory bridge) 
    {
        return bridges[_bridgeId];
    }

    /**
     * @dev Get supported chains
     * @return chains Array of supported chain IDs
     */
    function getSupportedChains() external view returns (uint256[] memory chains) {
        uint256 count = 0;
        for (uint256 i = 0; i < 100; i++) { // Assuming max 100 chains
            if (supportedChains[i].isActive) {
                count++;
            }
        }
        
        chains = new uint256[](count);
        uint256 index = 0;
        for (uint256 i = 0; i < 100; i++) {
            if (supportedChains[i].isActive) {
                chains[index] = i;
                index++;
            }
        }
    }

    /**
     * @dev Get bridge fee for an amount
     * @param _amount Amount to bridge
     * @return fee Bridge fee
     */
    function getBridgeFee(uint256 _amount) external view returns (uint256 fee) {
        return bridgeFee;
    }

    /**
     * @dev Emergency withdraw
     */
    function emergencyWithdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    /**
     * @dev Emergency withdraw tokens
     * @param _token Token address
     */
    function emergencyWithdrawToken(address _token) external onlyOwner {
        uint256 balance = IERC20(_token).balanceOf(address(this));
        if (balance > 0) {
            IERC20(_token).transfer(owner(), balance);
        }
    }

    // Allow contract to receive KDA
    receive() external payable {}
}

contracts/DelegatedAccount.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title DelegatedAccount
 * @dev Manages delegated accounts with spending limits for AI automation
 */
contract DelegatedAccount is Ownable, ReentrancyGuard {
    struct SpendingLimit {
        address token; // Token address (0x0 for native KDA)
        uint256 amount; // Maximum amount that can be spent
        uint256 spent; // Amount already spent
        uint256 resetTime; // When the limit resets
        bool isActive; // Whether the limit is active
    }

    struct DelegatedAccountInfo {
        address account; // Delegated account address
        address owner; // Main account owner
        SpendingLimit[] limits; // Spending limits
        bool isActive; // Whether the account is active
        uint256 createdAt; // Creation timestamp
    }

    // Mapping from delegated account to its info
    mapping(address => DelegatedAccountInfo) public delegatedAccounts;
    
    // Mapping from owner to their delegated accounts
    mapping(address => address[]) public ownerDelegatedAccounts;
    
    // Events
    event DelegatedAccountCreated(
        address indexed owner,
        address indexed delegatedAccount,
        address[] tokens,
        uint256[] amounts
    );
    
    event SpendingLimitUpdated(
        address indexed delegatedAccount,
        address indexed token,
        uint256 newAmount
    );
    
    event TransactionExecuted(
        address indexed delegatedAccount,
        address indexed to,
        uint256 value,
        bytes data
    );
    
    event DelegatedAccountDeactivated(address indexed delegatedAccount);

    /**
     * @dev Create a new delegated account with spending limits
     * @param delegatedAccount The address of the delegated account
     * @param tokens Array of token addresses (0x0 for native KDA)
     * @param amounts Array of spending limits for each token
     */
    function createDelegatedAccount(
        address delegatedAccount,
        address[] memory tokens,
        uint256[] memory amounts
    ) external onlyOwner {
        require(delegatedAccount != address(0), "Invalid delegated account");
        require(tokens.length == amounts.length, "Arrays length mismatch");
        require(!delegatedAccounts[delegatedAccount].isActive, "Account already exists");

        DelegatedAccountInfo storage info = delegatedAccounts[delegatedAccount];
        info.account = delegatedAccount;
        info.owner = msg.sender;
        info.isActive = true;
        info.createdAt = block.timestamp;

        // Set spending limits
        for (uint256 i = 0; i < tokens.length; i++) {
            info.limits.push(SpendingLimit({
                token: tokens[i],
                amount: amounts[i],
                spent: 0,
                resetTime: block.timestamp + 24 hours, // Daily reset
                isActive: true
            }));
        }

        ownerDelegatedAccounts[msg.sender].push(delegatedAccount);

        emit DelegatedAccountCreated(msg.sender, delegatedAccount, tokens, amounts);
    }

    /**
     * @dev Execute a transaction through a delegated account
     * @param to Recipient address
     * @param value Amount of native KDA to send
     * @param data Transaction data
     */
    function executeTransaction(
        address to,
        uint256 value,
        bytes memory data
    ) external nonReentrant {
        DelegatedAccountInfo storage info = delegatedAccounts[msg.sender];
        require(info.isActive, "Delegated account not active");
        require(info.owner != address(0), "Account not found");

        // Check spending limits for native KDA
        if (value > 0) {
            _checkSpendingLimit(info, address(0), value);
            _updateSpentAmount(info, address(0), value);
        }

        // Execute the transaction
        (bool success, ) = to.call{value: value}(data);
        require(success, "Transaction failed");

        emit TransactionExecuted(msg.sender, to, value, data);
    }

    /**
     * @dev Update spending limit for a token
     * @param delegatedAccount The delegated account address
     * @param token The token address
     * @param newAmount The new spending limit
     */
    function updateSpendingLimit(
        address delegatedAccount,
        address token,
        uint256 newAmount
    ) external {
        DelegatedAccountInfo storage info = delegatedAccounts[delegatedAccount];
        require(info.owner == msg.sender, "Not the owner");
        require(info.isActive, "Account not active");

        for (uint256 i = 0; i < info.limits.length; i++) {
            if (info.limits[i].token == token) {
                info.limits[i].amount = newAmount;
                emit SpendingLimitUpdated(delegatedAccount, token, newAmount);
                return;
            }
        }

        // If token not found, add new limit
        info.limits.push(SpendingLimit({
            token: token,
            amount: newAmount,
            spent: 0,
            resetTime: block.timestamp + 24 hours,
            isActive: true
        }));

        emit SpendingLimitUpdated(delegatedAccount, token, newAmount);
    }

    /**
     * @dev Deactivate a delegated account
     * @param delegatedAccount The delegated account to deactivate
     */
    function deactivateDelegatedAccount(address delegatedAccount) external {
        DelegatedAccountInfo storage info = delegatedAccounts[delegatedAccount];
        require(info.owner == msg.sender, "Not the owner");
        
        info.isActive = false;
        emit DelegatedAccountDeactivated(delegatedAccount);
    }

    /**
     * @dev Get delegated account information
     * @param delegatedAccount The delegated account address
     * @return info The delegated account information
     */
    function getDelegatedAccountInfo(address delegatedAccount) 
        external 
        view 
        returns (DelegatedAccountInfo memory info) 
    {
        return delegatedAccounts[delegatedAccount];
    }

    /**
     * @dev Get all delegated accounts for an owner
     * @param owner The owner address
     * @return accounts Array of delegated account addresses
     */
    function getOwnerDelegatedAccounts(address owner) 
        external 
        view 
        returns (address[] memory accounts) 
    {
        return ownerDelegatedAccounts[owner];
    }

    /**
     * @dev Check if a delegated account can spend a certain amount
     * @param delegatedAccount The delegated account address
     * @param token The token address
     * @param amount The amount to check
     * @return canSpendAmount Whether the account can spend the amount
     * @return remainingAmount The remaining spendable amount
     */
    function canSpend(
        address delegatedAccount,
        address token,
        uint256 amount
    ) external view returns (bool canSpendAmount, uint256 remainingAmount) {
        DelegatedAccountInfo memory info = delegatedAccounts[delegatedAccount];
        require(info.isActive, "Account not active");

        for (uint256 i = 0; i < info.limits.length; i++) {
            if (info.limits[i].token == token && info.limits[i].isActive) {
                uint256 available = info.limits[i].amount - info.limits[i].spent;
                return (amount <= available, available);
            }
        }

        return (false, 0);
    }

    /**
     * @dev Internal function to check spending limits
     */
    function _checkSpendingLimit(
        DelegatedAccountInfo storage info,
        address token,
        uint256 amount
    ) internal view {
        for (uint256 i = 0; i < info.limits.length; i++) {
            if (info.limits[i].token == token && info.limits[i].isActive) {
                require(
                    info.limits[i].spent + amount <= info.limits[i].amount,
                    "Spending limit exceeded"
                );
                return;
            }
        }
        revert("No spending limit found for token");
    }

    /**
     * @dev Internal function to update spent amount
     */
    function _updateSpentAmount(
        DelegatedAccountInfo storage info,
        address token,
        uint256 amount
    ) internal {
        for (uint256 i = 0; i < info.limits.length; i++) {
            if (info.limits[i].token == token) {
                info.limits[i].spent += amount;
                return;
            }
        }
    }

    // Allow contract to receive KDA
    receive() external payable {}
}

contracts/KadenaDEX.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title KadenaDEX
 * @dev A simple DEX for Kadena Chainweb EVM with swap and bridge functionality
 */
contract KadenaDEX is Ownable, ReentrancyGuard {
    struct TokenInfo {
        address tokenAddress;
        string symbol;
        uint8 decimals;
        bool isActive;
        uint256 totalLiquidity;
    }

    struct SwapPair {
        address tokenA;
        address tokenB;
        uint256 reserveA;
        uint256 reserveB;
        uint256 totalSupply;
        bool isActive;
    }

    struct BridgeInfo {
        address token;
        uint256 amount;
        uint256 targetChainId;
        address recipient;
        bool isProcessed;
        uint256 timestamp;
    }

    // State variables
    mapping(address => TokenInfo) public tokens;
    mapping(bytes32 => SwapPair) public swapPairs;
    mapping(uint256 => BridgeInfo) public bridges;
    
    address[] public tokenList;
    uint256 public bridgeCounter;
    
    // Events
    event TokenAdded(address indexed token, string symbol, uint8 decimals);
    event LiquidityAdded(
        address indexed tokenA,
        address indexed tokenB,
        uint256 amountA,
        uint256 amountB,
        address indexed provider
    );
    event SwapExecuted(
        address indexed tokenIn,
        address indexed tokenOut,
        uint256 amountIn,
        uint256 amountOut,
        address indexed user
    );
    event BridgeInitiated(
        uint256 indexed bridgeId,
        address indexed token,
        uint256 amount,
        uint256 targetChainId,
        address indexed recipient
    );
    event BridgeCompleted(uint256 indexed bridgeId);

    /**
     * @dev Add a new token to the DEX
     * @param tokenAddress The token contract address
     * @param symbol The token symbol
     * @param decimals The token decimals
     */
    function addToken(
        address tokenAddress,
        string memory symbol,
        uint8 decimals
    ) external onlyOwner {
        require(tokenAddress != address(0), "Invalid token address");
        require(!tokens[tokenAddress].isActive, "Token already added");

        tokens[tokenAddress] = TokenInfo({
            tokenAddress: tokenAddress,
            symbol: symbol,
            decimals: decimals,
            isActive: true,
            totalLiquidity: 0
        });

        tokenList.push(tokenAddress);
        emit TokenAdded(tokenAddress, symbol, decimals);
    }

    /**
     * @dev Add liquidity to a trading pair
     * @param tokenA First token address
     * @param tokenB Second token address
     * @param amountA Amount of tokenA to add
     * @param amountB Amount of tokenB to add
     */
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountA,
        uint256 amountB
    ) external payable nonReentrant {
        require(tokens[tokenA].isActive, "Token A not active");
        require(tokens[tokenB].isActive, "Token B not active");
        require(amountA > 0 && amountB > 0, "Invalid amounts");

        bytes32 pairKey = keccak256(abi.encodePacked(tokenA, tokenB));
        SwapPair storage pair = swapPairs[pairKey];

        if (pair.tokenA == address(0)) {
            // Create new pair
            pair.tokenA = tokenA;
            pair.tokenB = tokenB;
            pair.reserveA = amountA;
            pair.reserveB = amountB;
            pair.totalSupply = 1000; // Initial LP tokens
            pair.isActive = true;
        } else {
            // Add to existing pair
            require(pair.isActive, "Pair not active");
            
            // Calculate proportional amounts
            uint256 amountAOptimal = (amountB * pair.reserveA) / pair.reserveB;
            if (amountAOptimal <= amountA) {
                amountA = amountAOptimal;
            } else {
                amountB = (amountA * pair.reserveB) / pair.reserveA;
            }

            pair.reserveA += amountA;
            pair.reserveB += amountB;
        }

        // Transfer tokens from user
        if (tokenA != address(0)) {
            IERC20(tokenA).transferFrom(msg.sender, address(this), amountA);
        } else {
            require(msg.value >= amountA, "Insufficient KDA sent");
        }

        if (tokenB != address(0)) {
            IERC20(tokenB).transferFrom(msg.sender, address(this), amountB);
        }

        tokens[tokenA].totalLiquidity += amountA;
        tokens[tokenB].totalLiquidity += amountB;

        emit LiquidityAdded(tokenA, tokenB, amountA, amountB, msg.sender);
    }

    /**
     * @dev Execute a token swap
     * @param tokenIn Input token address (0x0 for KDA)
     * @param tokenOut Output token address (0x0 for KDA)
     * @param amountIn Amount of input token
     * @param minAmountOut Minimum amount of output token expected
     */
    function swap(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 minAmountOut
    ) external payable nonReentrant {
        require(amountIn > 0, "Invalid amount");
        require(tokenIn != tokenOut, "Same token");

        bytes32 pairKey = keccak256(abi.encodePacked(tokenIn, tokenOut));
        SwapPair storage pair = swapPairs[pairKey];
        require(pair.isActive, "Pair not active");

        uint256 amountOut;
        if (pair.tokenA == tokenIn) {
            amountOut = (amountIn * pair.reserveB) / (pair.reserveA + amountIn);
            pair.reserveA += amountIn;
            pair.reserveB -= amountOut;
        } else {
            amountOut = (amountIn * pair.reserveA) / (pair.reserveB + amountIn);
            pair.reserveB += amountIn;
            pair.reserveA -= amountOut;
        }

        require(amountOut >= minAmountOut, "Insufficient output amount");

        // Transfer input token
        if (tokenIn != address(0)) {
            IERC20(tokenIn).transferFrom(msg.sender, address(this), amountIn);
        } else {
            require(msg.value >= amountIn, "Insufficient KDA sent");
        }

        // Transfer output token
        if (tokenOut != address(0)) {
            IERC20(tokenOut).transfer(msg.sender, amountOut);
        } else {
            payable(msg.sender).transfer(amountOut);
        }

        emit SwapExecuted(tokenIn, tokenOut, amountIn, amountOut, msg.sender);
    }

    /**
     * @dev Initiate a cross-chain bridge
     * @param token Token to bridge (0x0 for KDA)
     * @param amount Amount to bridge
     * @param targetChainId Target chain ID
     * @param recipient Recipient address on target chain
     */
    function initiateBridge(
        address token,
        uint256 amount,
        uint256 targetChainId,
        address recipient
    ) external payable nonReentrant {
        require(amount > 0, "Invalid amount");
        require(recipient != address(0), "Invalid recipient");

        bridgeCounter++;
        bridges[bridgeCounter] = BridgeInfo({
            token: token,
            amount: amount,
            targetChainId: targetChainId,
            recipient: recipient,
            isProcessed: false,
            timestamp: block.timestamp
        });

        // Transfer tokens to contract
        if (token != address(0)) {
            IERC20(token).transferFrom(msg.sender, address(this), amount);
        } else {
            require(msg.value >= amount, "Insufficient KDA sent");
        }

        emit BridgeInitiated(bridgeCounter, token, amount, targetChainId, recipient);
    }

    /**
     * @dev Complete a bridge transaction (called by bridge operator)
     * @param bridgeId Bridge ID to complete
     */
    function completeBridge(uint256 bridgeId) external onlyOwner {
        BridgeInfo storage bridge = bridges[bridgeId];
        require(!bridge.isProcessed, "Bridge already processed");
        require(block.timestamp >= bridge.timestamp + 1 hours, "Bridge not ready");

        bridge.isProcessed = true;

        // In a real implementation, this would interact with the target chain
        // For now, we just mark it as completed

        emit BridgeCompleted(bridgeId);
    }

    /**
     * @dev Get swap pair information
     * @param tokenA First token address
     * @param tokenB Second token address
     * @return pair The swap pair information
     */
    function getSwapPair(address tokenA, address tokenB) 
        external 
        view 
        returns (SwapPair memory pair) 
    {
        bytes32 pairKey = keccak256(abi.encodePacked(tokenA, tokenB));
        return swapPairs[pairKey];
    }

    /**
     * @dev Get all available tokens
     * @return tokenAddresses Array of token addresses
     */
    function getAllTokens() external view returns (address[] memory tokenAddresses) {
        return tokenList;
    }

    /**
     * @dev Get bridge information
     * @param bridgeId Bridge ID
     * @return bridge The bridge information
     */
    function getBridgeInfo(uint256 bridgeId) 
        external 
        view 
        returns (BridgeInfo memory bridge) 
    {
        return bridges[bridgeId];
    }

    // Allow contract to receive KDA
    receive() external payable {}
}

